-- ----------------------------
--  Table structure for `task_project`
-- ----------------------------
DROP TABLE IF EXISTS `task_project`;
CREATE TABLE `task_project` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增',
  `task_id` int(10) NOT NULL COMMENT '关联发布任务id',
