-- ----------------------------
--  Table structure for `task_task`
-- ----------------------------
DROP TABLE IF EXISTS `task_task`;
CREATE TABLE `task_task` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增',
  `dir_name` varchar(50) NOT NULL COMMENT '生成的唯一的每次任务都会产生的目录名称',
  `state` tinyint(2) NOT NULL DEFAULT '0' COMMENT '当前任务状态（0：未开始；1：运行中；2：已结完成；-1：失败）',
  `create_time` int(10) NOT NULL COMMENT '任务创建时间',
  `flow_no` varchar(50) DEFAULT NULL COMMENT '流程的申请单号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=452 DEFAULT CHARSET=utf8 COMMENT='发布任务表';

