BEGIN;
INSERT INTO `upgrade_step` VALUES ('1', 'check', '10', '0', '应用及环境的检查', '1', 'app_db', '检查代码发布过程中所依赖的配置文件各项内容，如更新包是否已存放服务器上，能否正常解压，应用目录、备份目录和\r发布脚本目录是否存在，应用启动文件是否有权限，当前执行用户是否非root。检查依赖的基础命令如(tar、curl、zip等)和\r硬件资源cpu、内存、硬盘(初版先不检查)。'), ('2', 'backup', '20', '0', '应用的备份', '1', 'app', '根据配置文件查找应用目录和备份目录，使用 tar 命令打包业务系统代码目录内所有文件(tomcat为webapps)到唯一备份\r目录名下(例：/备份目录/项目名_版本号/项目名_版本号_时间.tar.gz)，并做好记录供回滚使用。'), ('3', 'exec_sql', '40', '0', '数据库的执行', '1', 'db', '数据库执行ing'), ('4', 'app_stop', '30', '0', '应用的停止', '1', 'app_db', '根据配置文件中用户名和应用目录查出进程ID号，使用kill -9 方式停止应用服务，日志输入记录杀死进程 ps -ef 详细\r信息。默认3秒后再次检测进程是否存在，存在则报错，否则正常。'), ('5', 'upgrade', '50', '0', '升级应用', '1', 'app', '根据配置文件查找更新包和应用目录，使用 mv 命令移动缓存(tomcat为work和temp目录)和容器内代码到发布脚本temp目\r录唯一名称下,然后拷贝更新包到应用目录(tomcat为webapps)中。'), ('6', 'app_start', '60', '0', '应用启动', '1', 'app_db', '根据配置文件查找应用目录和检查时间(如300秒)。启动应用，并在规定时间内检查输出日志文件。如tomcat启动，检查\r日志输出文件catalina.out中是否含有关键字“ INFO: Server startup in ”，成功匹配表示发布成功。'), ('7', 'rollback', '70', '0', '应用回滚', '1', 'app_db', '根据配置文件记录判断是否已进行备份，若有则可进行回滚代码操作，无则退出。回滚时判断应用是否已运行，若有则先\r停止应用并日志输出停止应用 ps -ef 详细信息。默认3秒后再次检测进程，若存在则自动退出。停止正常，则回滚前使用 mv\r命令移动缓存和容器内代码到发布脚本temp目录唯一名称下，再解压备份包到容器内，启动应用服务。'), ('8', 'upload', '0', '0', '文件上传', '1', 'app', '从FTP服务器下载war包到本地，将war包解压后，加入配置文件，再重新打包，最后将新的war包上传到要发布的服务器上。');
COMMIT;

-- ----------------------------
--  Table structure for `upgrade_user`
-- ----------------------------
DROP TABLE IF EXISTS `upgrade_user`;
CREATE TABLE `upgrade_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增唯一',
  `name` varchar(50) NOT NULL COMMENT '用户名',
  `password` varchar(50) NOT NULL COMMENT '用户密码',
  `home_dir` varchar(255) NOT NULL COMMENT '用户家目录',
  `machine_id` int(10) NOT NULL COMMENT '关联的机器ID',
  `sshport` int(10) unsigned NOT NULL DEFAULT '22' COMMENT 'ssh 协议连接端口号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

